import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes"

function App() {
  return (
    <div>
      <Header />
      <Note 
      heading={notes[0].title}
      description={notes[0].content}
      />
      <Footer />
    </div>
  );
}

export default App;
